1. fix regression test test_abort_txn_by_fe;

2. delete duplicated suites which just diff ClusterOptions.cloudMode = true/false,  no needn't.  ClusterOptions.cloudMode = null always support both mode;

3. improvement:  when run a docker suite with ClusterOptions.cloudMode == null,   if there's no an external doris cluster,  it will run both in cloud and not_cloud mode;
